import React from "react";

export default function Address() {
  return (
    <div style={(marginBottom = "15px")}>
      <input
        readOnly="true"
        class="form-control mr-lg-6"
        type="search"
        placeholder="Address"
        aria-label="Search"
      />
    </div>
  );
}
